import { FC } from 'react';
import { styled } from '@stitches/react';

const StyledSideber = styled('header', {
  background : 'rgba(6, 6, 6, 0.7)',
  color : '#FFFFFF',
  fontSize : '24px',
});

export const Sideber : FC = () => {
  return (
    <StyledSideber>
      <h3>All Note</h3>
      <h4>Programing</h4>
      <h5> React</h5>
      <h5> TypeScript</h5>
      <h5> Node</h5>
      <h5> Go</h5>
      <h5> Swift</h5>

      <h4>Design</h4>

      <h4>Books</h4>
      <h5> リーダブルコード</h5>
      <h5> React 実践の教科書</h5>
      <h5> Flutter 入門</h5>

    </StyledSideber>
  );
}
